import React from "react";

const Necas = ({ text }) => {
  console.log(text.Title);
  text.Search.map((t) => {
    return <p>{`Gay`}</p>;
  });
};

Necas.defaultProps = {
  text: ["Sharknado"],
};

export default Necas;
